import Circles from './assets/Circles.svg';
import './App.css';
import Typical from 'react-typical';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={Circles} className="App-logo" alt="logo"/> 
        <Typical
        steps={['Young.', 1300, 'Freelancer.', 1300, 'Webdesigner.', 1300, 'Disc-jockey.', 1300, 'Self-taught.']}
        loop={Infinity}
        className="App-logo-text"
        wrapper="p"
        />
      </header>
    </div>
  );
}

export default App;
